import React from "react";
import axios from "axios";

class App extends React.Component {
  state = {
    persons: [],
  };

  componentDidMount() {
    axios.get(`./bio.json`).then((res) => {
      const persons = res.data;
      this.setState({ persons });
    });
  }

  render() {
    return (
      <ul>
        {this.state.persons.map((person) => (
          <li>{person.name}</li>
        ))}
      </ul>
    );
  }
}

export default App;
